def explore(grid,x,y,row,col):
    if (x<0 or x>=row) or (y<0 or y>=col) or grid[x][y]=='W':
        return

    grid[x][y]='W'
    explore(grid,x,y-1,row,col)
    explore(grid,x-1,y,row,col)
    explore(grid,x,y+1,row,col)
    explore(grid,x+1,y,row,col)

def out_put(grid):
    print('[')
    for i in range(len(grid)-1):
        print(grid[i],',',sep='')
    print(grid[-1])
    print(']')

def island_count(grid):
    row=len(grid)
    col=len(grid[0])

    re=0
    for i in range(row):
        for j in range(col):
            if grid[i][j]=='L':
                re+=1
                # out_put(grid)
                explore(grid,i,j,row,col)
                # out_put(grid)
                # print('----------------------------')

    return re

